const string mark = "23456789TJQKA";

void solve() {
    while (true) {
        char trump;
        cin >> trump;
        if (trump == '#') break;

        ll rank[4][13];
        char suit[4][13];

        FOR(i, 0, 3) {
            FOR(j, 0, 12) {
                string S;
                cin >> S;
                FOR(k, 0, 12) {
                    if (S[0] == mark[k]) rank[i][j] = k;
                }
                suit[i][j] = S[1];
            }
        }

        V<ll> score(2, 0);
        ll deal = 0;
        FOR(j, 0, 12) {
            ll win = deal;
            FOR(i, 1, 3) {
                ll t = (win + i) % 4;
                if (suit[t][j] != trump && suit[t][j] != suit[win][j]) continue;
                if (suit[t][j] == trump && suit[win][j] != trump) {
                    win = t;
                } else if (rank[t][j] > rank[win][j]) {
                    win = t;
                }
            }

            ++score[win % 2];
            deal = win;

            // cout << "NESW"[win];
        }
        // cout << endl;

        ll winner = (score[0] > score[1] ? 0 : 1);
        cout << (winner ? "EW" : "NS") << " " << score[winner] - 6 << endl;
    }
}

