struct State{
	int n, id;
	char m;

	State(){};
	State(int n_, int id_, char m_){
		n = n_;
		id = id_;
		m = m_;
	};
};

bool operator < (const State &a, const State &b){
	if(a.m == trump){
		if(b.m == trump){
			return (a.n < b.n);
		}else{
			return false;
		}
	}else{

		if(b.m == trump){
			return true;
		}else{
	 		if(a.n == b.n){
	 			return (a.id > b.id);
	 		}

			return a.n < b.n;
	 	}

	}
}

//card state
State get_state(string c, int p, int start){
	int n = h[c[0]], id;
	char m = c[1];

	for(int i = 0, k = start; i < 4; i++, (k = (k + 1) % 4)){
		if(k == p){
			id = i;
			break;
		}
	}

	return State(n, id, m);
}

