    for ( int t = 0; t < 13; t++ ) {
      int win = ldr;
      int num = cards[ldr][t].first;      
      char suit = cards[ldr][t].second;      
      for ( int i = 1; i < 4; i++ ) {
	int mem = (ldr+i)%4;	
