            char trump2 = v[win_player][i][1];
            int win_player2 = 0;
            for(int j=0; j<4; ++j) {
                int cp = (win_player+j)%4;
                if(is_trump) {
                    if(m[v[cp][i][0]] > rank && v[cp][i][1] == trump) {
                        rank = m[v[cp][i][0]];
                        win_player2 = cp;
                    }
                } else {
                    if(v[cp][i][1] == trump) {
                        is_trump = true;
                        rank = m[v[cp][i][0]];
