		case 'A':
			return 1;
		case 'T':
			return 10;
		case 'J':
			return 11;
		case 'Q':
			return 12;
		case 'K':
			return 13;
		default:
			return arg-'0';
	}
	return 0;
}

inline int judge(int i,int a,int b){
	int an=number(card[a][i][0]);
	int ac=suit(card[a][i][1]);
	int bn=number(card[b][i][0]);
	int bc=suit(card[b][i][1]);
	if(ac==bc){
		if(an==1)
			return a;
		if(bn==1)
			return b;
		if(an>bn)
			return a;
		else
			return b;
	}else{
		if(ac>bc)
			return a;
		else
			return b;
	}
	return 0;
}

int proceed(int i,int d){
	int res=d;
	string s=card[d][i];
	start=card[d][i][1];
	for(int j=1;j<=3;++j){
		int cur=(d+j)%4;
		res=judge(i,res,cur);
	}
	return res;
}

