      if (wi == 0 || wi == 2) nswin++;
      else ewwin++;

      ld = wi;
    }
    //printf("ns=%d, ew=%d\n", nswin, ewwin);

    if (nswin > ewwin)
      printf("NS %d\n", nswin - 6);
