		return 11;
	case 'Q':
		return 12;
	case 'K':
		return 13;
	case 'A':
		return 14;
	}
	return -1;
}

bool wins(char a, char b) {
	return encode(a) > encode(b);
}

void solve() {
	int score[4] = {0,0,0,0};
	int start = 0;

	for_(i,0,13) {
		int t = start;

		char rank = NESW[t][i][0];
		char base = NESW[t][i][1];
		bool tflag = false;
		if (base == trump) tflag = true;
		int win = t;

		for_(j,0,4) {
			int tt = (t + j) % 4;
			char rankj = NESW[tt][i][0];
			char basej = NESW[tt][i][1];

			if (tflag) {
				// trump flag
				if (basej == trump && wins(rankj, rank)) {
					rank = rankj;
					win = tt;
				}
			} else {
				// no torump flag
				if (basej == trump) {
					tflag = true;
					rank = rankj;
					win = tt;
				} else if (basej == base && wins(rankj, rank)){
					rank = rankj;
					win = tt;
				}
			}
		}

		start = win;
		score[win]++;
	}

	if (score[0] + score[2] >= 7) {
		cout << "NS " << score[0] + score[2] - 6 << endl;
	} else {
		cout << "EW " << score[1] + score[3] - 6 << endl;
	}
}

